t_is_DVG = {}
y_is_DVG = {}
for i in range(1,25):
    t_i = .1*(i-1)
    t_is_DVG[i] = t_i
    y_is_DVG[i] = 53.81*(1.27**t_i)*np.tanh(3.012*t_i+np.sin(2.13*t_i))*np.cos(t_i*np.exp(.507))
def DeVilliersGlasser02(solutions):
    evaluations = np.zeros((len(solutions), ))
    for i in range(1, 25):
        t_i = t_is_DVG[i]
        y_i = y_is_DVG[i]
        first_part = solutions[:, 0]*solutions[:, 1]**t_i
        second_part = np.tanh(solutions[:, 2]*t_i + np.sin(solutions[:, 3]*t_i))
        third_part = np.cos(t_i*np.exp(solutions[:, 4]))
        evaluations += (first_part*second_part*third_part-y_i)**2
    return evaluations

