def cross_leg_table(solutions):
    evaluations = -1.0 / (np.abs( np.sin(solutions[:, 0])*np.sin(solutions[:, 1])*np.exp(100-(np.sqrt( solutions[:, 0]**2 + solutions[:, 1]**2 ))/np.pi) ) +1)**.1
    return evaluations
