def XinSheYang03(solutions):
    first_sum = -(solutions[:, 0]/15.0)**6.0 -(solutions[:, 1]/15.0)**6.0
    second_sum = -solutions[:, 0]**2 - solutions[:, 1]**2
    product = (np.cos(solutions[:, 0])**2)*(np.cos(solutions[:, 1])**2)
    evaluations = np.exp(first_sum)-2*np.exp(second_sum)*product
    return evaluations
