def SineEnvelope(solutions):
    numerator = np.sin( np.sqrt( solutions[:, 1]**2 + solutions[:, 0]**2 ) - .5 )**2
    denominator = (.001*(solutions[:, 1]**2 + solutions[:, 0]**2) + 1)**2
    evaluations = -(numerator/denominator + .5)
    return evaluations
