(best_solution, best_fitness), metrics = GO.GA()

def Whitley(solutions):
    evaluations = np.array([0.,0.])
    for i in range(len(solutions[0])):
        for j in range(len(solutions[0])):
            temp = 100*(solutions[:, i]**2-solutions[:, j])**2 + (1-solutions[:, j])**2
            evaluations += (temp**2/4000.0) - np.cos(temp) + 1
    return np.array(evaluations)
GO = GeneticOptimizer(objective = Whitley, lb = np.array([-10.24]*2), ub = np.array([10.24]*2), min_target = 0)
(best_solution, best_fitness), metrics = GO.GA()

